    <div className="Buy_App">
      <div className="Buy_container">
        <div>Your_balance_eth : 0 </div>
        <div className="Buy_layout">
          <div className="Buy_title">
            <div>Change Swap!</div>
            <div>Eth To Token!!</div>
          </div>
          <input type="text" className="Buy_eth" placeholder="eth.." />
          <input type="text" className="Buy_eth" placeholder="Gold.." />
          <button className="Buy_button">스왑!</button>
        </div>
      </div>
    </div>
  );
}

export default Buy;
